script: |
  super -f text -I q837.spq | sort > q837.out

inputs:
  - name: q837.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE - col0 / 47 NOT IN ( + - col1, + col1 * - col0 * + col0 - - + col1 * - 35 );
  - name: tab1

outputs:
  - name: q837.out
    data: |
      51	14	96
      85	5	59
      91	47	68
